scriptlet.script:
try{
	var strArray = rowData.split("");
	var marginType = strArray.slice(0,4).join('').trim();
	var startDate = strArray.slice(8,18).join('').trim();
	var expireDate = strArray.slice(21,31).join('').trim();
	var rateAdj = strArray.slice(36,43).join('').trim();
	var reasonCode = strArray.slice(47,62).join('').trim();
	var authMgr = strArray.slice(64,71).join('').trim();

	var line = "<vmgd INDEX=\""+index+"\" MARGIN_TYPE=\""+marginType+"\" START_DATE=\""+startDate+"\" EXPIRE_DATE=\""+expireDate+"\" RATE_ADJ=\""+rateAdj+"\" REASON_CODE=\""+reasonCode+"\" AUTH_MGR=\""+authMgr+"\"/>"

	scriptletContext.put("xmlRowVMGD", line);
	response = "success";
} catch(err) {
	scriptletContext.put("errorMessage",err.message);	
	response = "failure";
}
scriptletResponse = response
